import "../index.css";
import "../styles/TargetList.css";
function TargetList({ x, y, list }) {
  return (
    <div
      className="targetList"
      style={{
        top: `${y}px`,
        left: `${x}px`,
      }}
    >
      {list.map((target, index) => (
        <div key={index} className="listBox">
          <img src={target.image} className="listBoxImg" alt=""></img>
          <p>{target.name}</p>
        </div>
      ))}
    </div>
  );
}

export default TargetList;
